import React from "react";

const DroneListItem = (props) => {
    <li key={props.droneData[props.drone].children[0].value}>{props.droneData[props.drone].children[0].value} y: {props.droneData[drone].children['7'].value} x: {props.droneData[drone].children['8'].value}</li>
};

export default DroneListItem;
